import React from "react";

class TestClass extends React.Component{
    render(){
        return (
            <div>hello world!</div>
        )
    }
}

function TestFunction (){
    return(
        <div>
            <h1>HELLO WORLD !</h1>
            <h1></h1><TestClass/>
        </div>
    )
}

export default TestFunction
